window.bookSummaryJSON = "<p><b>2021 Hudson Booksellers Best of the Year</b></p> <p><b>An Instant </b><b><i>New York Times</i></b><b> Best Seller</b><br> <br> <b>\"A vibrant, engrossing, unputdownable thriller that packs a serious emotional punch. One of those rare books that surprise you along the way and then linger in your mind long after you have finished it.\" (Kristin Hannah, number one </b><b><i>New York Times </i></b><b>best-selling author of </b><b><i>The Nightingale</i></b><b> and </b><b><i>The Four Winds</i></b><b>)</b><br> <br> <b>Right. Wrong. Life is lived somewhere in between.</b><br> <br> Duchess Day Radley is a 13-year-old self-proclaimed outlaw. Rules are for other people. She is the fierce protector of her five-year-old brother, Robin, and the parent to her mother, Star, a single mom incapable of taking care of herself, let alone her two kids.<br> <br> Walk has never left the coastal California town where he and Star grew up. He may have become the chief of police, but heâ€™s still trying to heal the old wound of having given the testimony that sent his best friend, Vincent King, to prison decades before. And he's in overdrive protecting Duchess and her brother.<br> <br> Now, 30 years later, Vincent is being released. And Duchess and Walk must face the trouble that comes with his return. <i>We Begin at the End</i> is an extraordinary novel about two kinds of families- the ones we are born into and the ones we create. </p> <p><b>A Macmillan Audio production from Henry Holt and Company</b></p> <p>\"Heartbreaking, unexpected, and hopeful, this audiobook is a must-listen. Narrator George Newbern's nuanced delivery engages listeners and helps the layers of the story unfold.\" (<i>AudioFile Magazine</i>)</p>"; 
